	private void incluiBairro (String siglaEstado, String nomeCidade, String nomeBairro) {

		Optional<Estado> estado = estadoService.buscarPorSigla(siglaEstado);
		if (!estado.isPresent()) {
			return;
		}
		Integer estadoId = estado.get().getId();
		
		Optional<Cidade> cidade = cidadeService.buscarPorCidadeAndEstadoId(nomeCidade, estadoId);
		
		if (!cidade.isPresent()) {
			return;
		}
		
		Bairro bairro = new Bairro(null, nomeBairro, cidade.get());
		bairroRepository.save(Arrays.asList(bairro));
		
		return;

	}
